        key={i}
        title={info.volumeInfo.title}
        book_author={"authors" in info.volumeInfo}
        book_cost= {"cost" in info.volumeInfo}
        book_snippet={ "snippet" in searchInfo.textSnippet}
        />
    ));

return (
  <div className="FilterableList">
      <ul>
        {bookInfo}
      </ul>  
      </div>
 );      
}
}

FilterableList.defaultProps = {
  Book: []
};


